import React from 'react';
import '../VoiceSearch/index.css';

function VoiceSearch() {
    return (
        <div className='col-md-12 d-flex align-item-center justify-content-center  voiceModel'>
          <div className='col-md-6 bg-light voice-search'>
                <div className='border-bottom w-100 d-flex align-items-center justify-content-between'> 
                <h3>Voice Search</h3>
                <i className='fa fa-times btn btn-sm'>

                </i>
                </div>
          </div>
        </div>
    );
}

export default VoiceSearch;
